const Container = styled.div``;
const ColumnLeft = styled.div``;
const ColumnRight = styled.div``;

const InfoSection = () => {
    return (
        <Section>
           <Container>
               <ColumnLeft>
               <h1>heading</h1>
               <p>paragraph</p>
               <p>paragraph</p>
               <Button to="/blog">label</Button>
               </ColumnLeft>
               <ColumnRight>
               </ColumnRight>
               <img src= "" alt="blog" />
           </Container>
        </Section>
    );
};

export default InfoSection;
